import Row from './Row';

const Grid = (props) => {
    const {data} = props;
    const odd = data.length % 2;
    let i = 0;
    let video ;
    if(odd) {
        video = data.pop();
    }
    return (
        <div>
            {
                odd ?
                <div> 
                    <Row video1={video} video2={undefined} />
                </div> 
                :
                <div></div>
            }
            {
                
            }
        </div>
    )
}


export default Grid
